import React from 'react';
import './App.css';

import {HashRouter as Router, Route} from 'react-router-dom';

import {Container, Jumbotron} from "react-bootstrap";

import QuestionList from "./components/QuestionList";

import questions from "./questions/ooad/ooad";

let fs = require('fs');

let rawdata = fs.readFileSync("./questions/files/test.txt", "utf8");
let ques = JSON.parse(rawdata);
// console.log(ques);

let data = JSON.stringify(ques);
fs.writeFile('./questions/ooad/test.json', ques);



function App() {
  return (
    <Router>
      <Container>
        <Jumbotron>
          <Route path="/" exact component={() => <QuestionList questions={questions} />} />
        </Jumbotron>
      </Container>
    </Router>
  );
}

export default App;
